import React, {Component} from 'react';
import './Footer.css';

class Footer extends Component {
    render() {
        let date = new Date();
        let copyright_symbol = "&#x24B8";
        return (
            <div className="Footer">
                {{copyright_symbol}} Copyright {date.getFullYear()}, Lift Weights by Michelle Duer
            </div>
        );
    }
}

export default Footer;
